import "./Row_styles.scss";
import React from "react";
import Cell from "../Cell/Cell";

const RowFreespace = () => {
  return (
    <div className="row">
      <Cell cellClass="cell js-tilt" cellText="Go to the Bathroom and smoke" />
      <Cell cellClass="cell js-tilt" cellText="" />
      <Cell cellClass="free_space" cellText="Free Space" />
      <Cell cellClass="cell js-tilt" cellText="" />
      <Cell cellClass="cell js-tilt" cellText="" />
    </div>
  );
};

export default RowFreespace;
